import React from 'react'
import {
  CssBaseline,
  Drawer,
  Box,
  AppBar,
  Toolbar,
  List,
  Typography,
  Divider,
  IconButton,
  Container,
  Link as MUILink,
  ListItem,
  ListItemText,
  ListItemIcon,
  ListSubheader,
} from '@material-ui/core'
import { Link, useLocation } from 'react-router-dom'

import {
  ChevronLeft as ChevronLeftIcon,
  Menu as MenuIcon,
  Dashboard as DashboardIcon,
  Assignment as AssignmentIcon,
  People as PeopleIcon,
  FormatQuote as FormatQuoteIcon,
  SettingsEthernet as SettingsEthernetIcon,
  Textsms as TextsmsIcon,
  Style as StyleIcon,
  Timeline as TimelineIcon,
  Autorenew as AutorenewIcon,
  SelectAll as MoreTimeIcon,
  Twitter as TwitterIcon,
} from '@material-ui/icons'

export default function Menu({ className = '' }) {
  const classes = className
  const [open, setOpen] = React.useState(true)
  const handleDrawerOpen = () => {
    setOpen(true)
  }
  const handleDrawerClose = () => {
    setOpen(false)
  }

  const [selectedIndex, setSelectedIndex] = React.useState(1)
  const handleListItemClick = (event, index) => {
    setSelectedIndex(index)
  }

  return (
    <React.Fragment>
      <List>
        <ListSubheader
          component="div"
          id="nested-list-subheader"
          style={{ background: '#FFF' }}
        >
          Analytic Mode
        </ListSubheader>
        <Divider />

        <Link
          to="/projectautomatic"
          className={classes.navLink}
          state={{ projectType: 'automatic' }}
        >
          <ListItem
            button
            selected={selectedIndex === 0}
            onClick={(event) => {
              return handleListItemClick(event, 0)
            }}
          >
            <ListItemIcon style={{ color: '#12939A' }}>
              <AutorenewIcon />
            </ListItemIcon>
            <ListItemText primary="Automatic Mode" />
          </ListItem>
        </Link>
        <Link to="/project" className={classes.navLink}>
          <ListItem
            button
            selected={selectedIndex === 1}
            onClick={(event) => {
              return handleListItemClick(event, 1)
            }}
          >
            <ListItemIcon style={{ color: '#12939A' }}>
              <MoreTimeIcon />
            </ListItemIcon>
            <ListItemText primary="Request Mode" />
          </ListItem>
        </Link>
      </List>
      <Divider />
      <ListSubheader
        component="div"
        id="nested-list-subheader"
        style={{ background: '#FFF' }}
      >
        Social Network Analyzer
      </ListSubheader>
      <Divider />
      <Link to="/overview" className={classes.navLink}>
        <ListItem
          button
          selected={selectedIndex === 2}
          onClick={(event) => {
            return handleListItemClick(event, 2)
          }}
        >
          <ListItemIcon style={{ color: '#12939A' }}>
            <AssignmentIcon />
          </ListItemIcon>
          <ListItemText primary="Overview" />
        </ListItem>
      </Link>

      <Link to="/twitteruser" className={classes.navLink}>
        <ListItem
          button
          selected={selectedIndex === 4}
          onClick={(event) => {
            return handleListItemClick(event, 4)
          }}
        >
          <ListItemIcon style={{ color: '#12939A' }}>
            <PeopleIcon />
          </ListItemIcon>
          <ListItemText primary="User" />
        </ListItem>
      </Link>

      <Link to="/tweets" className={classes.navLink}>
        <ListItem
          button
          selected={selectedIndex === 3}
          onClick={(event) => {
            return handleListItemClick(event, 3)
          }}
        >
          <ListItemIcon style={{ color: '#12939A' }}>
            <TwitterIcon />
          </ListItemIcon>
          <ListItemText primary="Tweets" />
        </ListItem>
      </Link>

      <Link to="/timeline" className={classes.navLink}>
        <ListItem
          button
          selected={selectedIndex === 9}
          onClick={(event) => {
            return handleListItemClick(event, 9)
          }}
        >
          <ListItemIcon style={{ color: '#12939A' }}>
            <TimelineIcon />
          </ListItemIcon>
          <ListItemText primary="Time Line " />
        </ListItem>
      </Link>

      <Divider />
      <ListSubheader
        component="div"
        id="nested-list-subheader"
        style={{ background: '#FFF' }}
      >
        Settings
      </ListSubheader>
      <Divider />
      <Link to="/users" className={classes.navLink}>
        <ListItem
          button
          selected={selectedIndex === 9}
          onClick={(event) => {
            return handleListItemClick(event, 9)
          }}
        >
          <ListItemIcon style={{ color: '#12939A' }}>
            <PeopleIcon />
          </ListItemIcon>
          <ListItemText primary="Users" />
        </ListItem>
      </Link>
      <Divider />
    </React.Fragment>
  )
}
